import React from 'react';
import Card from '../components/Card';
import CardBlock from '../components/CardBlock';
const MainPage = ({ word, desc, example }) => {
  return (
    <>
      <h3>MY DICTIONNARY</h3>
      <Card>
        <CardBlock></CardBlock>
      </Card>
    </>
  );
};

export default MainPage;
